import './shop.css';
import ShopProduct from './shopProduct';

function Shop () {
    fetch('http://localhost:3000/product')
        .then(response => response.json())
        .then(data => console.log(data));


    return <div className="product-list">
        <h2>Shop</h2>
   
        <ShopProduct />
    </div>
}
export default Shop;
